        <Link to={`/categories/jobs/${slug}`} >
            <div className="category-container--card-wrapper__card">
                <img src={icon} alt="Category-icon" width="100px" height="100px"/>
                <h1>{name}</h1>
            </div>
        </Link>
    );
};

